import Ho from './Home.module.css';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className={Ho.main}>
     <div className={Ho.sidebar}>
      <div className={Ho.navbar}>
        <nav>
          <h1>Todo List</h1>
          <Link className={Ho.l}>About</Link>
          <Link className={Ho.l}>About</Link>
          <Link className={Ho.l}>About</Link>
          <Link className={Ho.l}>About</Link>
        </nav>
      </div>
     </div>
    </div>
    
  );
}

export default Home;
